import image from '../image.webp';
import'../Style/App.css';
const Card = () => {
  // Generate random image URL
  const getRandomImage = () => {
    // Replace this logic with your own random image URL generation
    const randomImageUrls = [image, image, image];
    const randomIndex = Math.floor(Math.random() * randomImageUrls.length);
    return randomImageUrls[randomIndex];
  };

  // Array of card data
  const cardData = [
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },
    { name: 'One Plus', message: 'Android Device', img: image },

    { name: 'Samsung S22', message: 'Android Device', img: image },
    { name: 'Iphone 14', message: 'iOS Device', img: image },
  ]; 

  return (
    <>
    {cardData.map((item, index) => (
      <figure class="snip1577" key={index}>
        <img src={item.img} alt="sample99" />
        <figcaption>
          <h3>{item.name}</h3>
          <h4><a href=''>{item.message}</a></h4>
          <h4></h4>
         
      
        </figcaption>
      
      </figure>
      
    ))}
    </>
  );
};

export default Card;
